import React from 'react'
import LogInPage from './LogInPage'
import InterfacePage from './InterfacePage'

class Main extends React.Component<{}, {isLoggedIn: boolean, user:string}>{

  constructor(props: any){
    super(props)
    this.state = {
      isLoggedIn: false,
      user: ''
    }
    this.login = this.login.bind(this)
  }

  login = () =>{
    this.setState({isLoggedIn: true, user: 'ass'})
  }

  render(){
    return (
      <div className="App">
        {this.state.isLoggedIn ? <InterfacePage/> : <LogInPage login={this.login}/>}
      </div>
    );
  }
}

export default Main
